import register from '../register';
import {
    getParams
} from '../utils';
import stringify from '../stringify'
import log from './index';


register('profilePerformanceFlowEvent', {
    v: 36,
    androidVersionRange: ['11.0'],
    iosVersionRange: ['11.1'],
    hasCB: false,
    filter: data => {
        return {
            action: 'onProfilePerformanceFlowEvent',
            module: 'utils',
            data: {
                params: stringify(data, true)
            }
        };
    }
});
/**
 * profilePerformanceFlowEvent
 * @function profilePerformanceFlowEvent
 * @param {object} [data={}] - ubc 参数
 */
export default (data = {}) =>
log(
    getParams('profilePerformanceFlowEvent', data)
);
